    methods: {
        toggleSelection(attribute, value) {
            this.isLoading = true;  // 开启加载指示符
            
            const index = this[attribute].indexOf(value);
            if (index === -1) {
                this[attribute].push(value);
            } else {
                this[attribute].splice(index, 1);
            }
    
            // 加一个小延迟让加载符号可见，模拟处理时间（可选）
            setTimeout(() => {
                this.isLoading = false;  // 关闭加载指示符
            }, 100);  // 这里的100是延迟的毫秒数，可以根据需要调整
        },
    },
    
    computed: {
        sortedAndFilteredRecommendations() {
            return this.displayedRecommendations.filter(rec => {
                if (this.selectedSchoolLevel && !rec.school_type.includes(this.selectedSchoolLevel)) {
                    return false;
                }
                if (this.selectedProvince && this.selectedProvince !== rec.school_region) {
                    return false;
                }
                return true;
            }).sort((a, b) => {
                return this.sortOrder === 'asc' ? a.rank - b.rank : b.rank - a.rank;
            });
        }
    }
